JOBS IN #PHILLY!

@CareersUsps is hiring automotive technicians in Philly and will be hosting a job fair this Tuesday, December 17 from 10 AM to 2 PM.

To learn more about this fair and how to apply online, please visit: https://t.co/Xfw0oIvqgU https://t.co/BBOg579iFC

🚨Is your ballot one of 2,900 in #Philly with an error? 🚨

@PhillyVotes has identified mail-in &amp; absentee ballots with various issues that can prevent them from being counted.

Visit https://t.co/JAaBeRsALM to see the list &amp; how to fix issues or get a replacement ballot! https://t.co/ZfLK9PdJ3l

America runs on child care!

@HouseDemocrats know that when we invest in child care, everyone is better off.

That's why while the House GOP tries to hike costs and eliminate Head Start, we're fighting to make child care affordable and accessible for ALL. #ChildCareWeekofAction https://t.co/CYObp89dnA

Big news rolling into #Philly!🚆

@Amtrak is investing $462 MILLION right here to help improve passenger rail service &amp; create good-paying JOBS.

I was proud to vote for the Infrastructure &amp; Jobs Act that made this project possible. This is what investing in America looks like! https://t.co/iv3PCk9LJB
